import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import logo from './assets/logo.svg'


export default function App() {

  return (

    <>
      <Container style={styles.myStyle}>
        <Row>
          <Col>1 of 4</Col>
          <logo />
          <Col>2 of 4</Col>
          <Col>3 of 4</Col>
          <Col>4 of 4</Col>
        </Row>
      </Container>
    </>
  );

};

const styles = {
    myStyle: {
      textAlign: 'center',
      color: '#fff'
    }
};
